import React from 'react';
import { FaGithub, FaLinkedin } from 'react-icons/fa';

const Footer = () => {
  const year = new Date().getFullYear();

  return (
    <footer className="bg-dark-card text-dark-text py-6">
      <div className="container mx-auto px-4 text-center">
        <div className="flex justify-center space-x-6 mb-4">
          <a href="https://github.com/Ravi19092004" target="_blank" rel="noopener noreferrer" className="hover:text-primary transition-colors">
            <FaGithub size={24} />
          </a>
          <a href="https://www.linkedin.com/in/your-linkedin-profile" target="_blank" rel="noopener noreferrer" className="hover:text-primary transition-colors">
            <FaLinkedin size={24} />
          </a>
          {/* Add other social links here */}
        </div>
        <p>&copy; {year} Ravishankar Gharabidi. All Rights Reserved.</p>
      </div>
    </footer>
  );
};

export default Footer;
